import React, {Component} from 'react';
import {StyleSheet, View, Image, Text } from 'react-native';

export default class Card extends React.PureComponent{
    render(){
        return(
            <View style ={styles.Container}>
                <View style ={styles.Card}>
                <Text style={styles.CardText}>Sembuh</Text>
                </View>
                <Text style={styles.CardText}>Sembuh</Text>
                
               
            </View>
            

            
        );
    }
}

const styles = StyleSheet.create({
    container: {
        marginTop:20,
        backgroundColor: '#000',
    },
    Card: {
        backgroundColor: 'yellow',
        marginBottom:10,
        marginLeft: '5%',
        width: '20%',
        shadowColor: '#000',
        shadowOpacity:0.2,
        shadowRadius:1,
        shadowOffset:{
            width:3,
            height:3
        }
    },
    Card1: {
        backgroundColor: 'yellow',
         marginBottom:10,
         marginLeft: '15%',
         width: '2%',
        shadowColor: '#000',
         shadowOpacity:0.2,
        shadowRadius:1,
        shadowOffset:{
        width:3,
        height:3
       }
    },
CardText:{
    padding:10,
    fontSize:16
    },
});
